import React, { Component } from 'react';
import Banner from './components/Banner'

import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
      	<Banner />
        <h1>Nigel's Website</h1>
      </div>
    );
  }
}

export default App;
